INSERT INTO `posts` VALUES (6,20,'Syarat & Ketentuan','<p><img src=\"https://bakawan.banjarmasinkota.go.id/uploads/posts/1655088748_Penerima.jpg\" class=\"img-fluid img-thumbnail\"><br></p>','Publish','2021-10-18 20:14:28','2022-06-12 18:52:30'),(7,20,'Aplikasi Bakawan RTLH Siap Diluncurkan','<p>Aplikasi Bakawan (Banjarmasin Aplikasi Wadah Pendataan) RTLH (Rumah Tidak Layak Huni) dari Dinas Perumahan Rakyat dan Kawasan Permukiman Kota Banjarmasin untuk mempermudah pelayanan publik berbasis Smart City sebagai salah satu visi dan misi Banjarmasin Baiman 2</p>','Publish','2021-10-18 21:51:03','2022-01-03 18:52:06'),(8,20,'Perubahan Nama Dinas dan Nomenklatur','<p>Per tanggal 1 Januari 2022, nama Dinas Perumahan dan Kawasan Permukiman Kota Banjarmasin berubah menjadi Dinas Perumahan Rakyat dan Kawasan Permukiman.</p>','Publish','2022-01-03 18:54:16','2022-01-03 18:54:16'),(10,26,'INFORMASI LAYANAN BAKAWAN RTLH','<p>Untuk mendapatkan informasi lebih lengkap terkait Bakawan RTLH bisa kontak akun berikut</p>\r\n\r\n<p><a href=\"https://www.instagram.com/dprkp.bjm/\" target=\"_blank\"><img src=\"https://bakawan.banjarmasinkota.go.id/uploads/posts/1659596483_IG.png\" class=\"img-fluid img-thumbnail\" style=\"width: 50px;\"></a><br></p>\r\n\r\n<p><a href=\"https://wa.me/6285821343090\" target=\"_blank\"><img src=\"https://bakawan.banjarmasinkota.go.id/uploads/posts/1659597155_whatsapp.png\" class=\"img-fluid img-thumbnail\" style=\"width: 50px;\"></a></p>','Publish','2022-08-03 23:11:49','2022-08-03 23:13:41');
